import React, { useState } from "react";

const BookAd = () => {
  const [content, setContent] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Ad Submitted: ${content}`);
  };

  return (
    <div>
      <h2>Book an Advertisement</h2>
      <form onSubmit={handleSubmit}>
        <textarea
          placeholder="Enter ad content..."
          value={content}
          onChange={(e) => setContent(e.target.value)}
          required
        />
        <button type="submit">Book Ad</button>
      </form>
    </div>
  );
};

export default BookAd;
